import React from "react";
import  s from './Sidebar.module.css';
function Sidebar() {
    return(
    <div className={s.sidebar}>
        <ul>
            <li href="/profile">Profile</li>
            <li href="/dialogs">Messages</li>
            <li>Audio</li>
            <li>Video</li>
            <li>Communities</li>
            <li>Settings</li>
            <li>Exit</li>
        </ul>
    </div>)
}
export default Sidebar;
